import instance from './instance';
import { convertRESTAPI } from '../util';

/** 退回任务候选节点 */
function process_instances_reject_nodes_get(opts) {
  return instance({
    method: 'get',
    url: '/process-instances/reject-nodes',
    opts: opts,
  });
}

