  });
}

/** 撤回任务 */
function me_revoke_tasks_taskId_patch(opts) {
  return instance({
    method: 'patch',
    url: convertRESTAPI('/me/revoke-tasks/{taskId}', opts),
    opts: opts,
  });
}

